-- ----------------------------
-- Table structure for chatbull_anonymous_messages
-- ----------------------------
DROP TABLE IF EXISTS `chatbull_anonymous_messages`;
CREATE TABLE `chatbull_anonymous_messages`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `temp_visitor_id` int(11) UNSIGNED NOT NULL,
  `sender_id` int(11) UNSIGNED NOT NULL,
  `local_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `sort_order` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `chat_message` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `message_status` enum('read','unread') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'unread',
  `created_at` timestamp(0) NOT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `temp_visitor_id`(`temp_visitor_id`) USING BTREE,
  CONSTRAINT `chatbull_anonymous_messages_ibfk_1` FOREIGN KEY (`temp_visitor_id`) REFERENCES `chatbull_temp_visitors` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for chatbull_canned_messages
-- ----------------------------
DROP TABLE IF EXISTS `chatbull_canned_messages`;
CREATE TABLE `chatbull_canned_messages`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `user_id` int(11) UNSIGNED NOT NULL,
  `title` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '',
  `description` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `created_at` timestamp(0) NOT NULL,
  `updated_at` timestamp(0) NOT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE,
  CONSTRAINT `chatbull_canned_messages_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `chatbull_users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for chatbull_chat_messages
-- ----------------------------
DROP TABLE IF EXISTS `chatbull_chat_messages`;
CREATE TABLE `chatbull_chat_messages`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `chat_session_id` int(11) UNSIGNED NOT NULL,
  `sender_id` int(11) UNSIGNED NOT NULL,
  `local_id` varchar(25) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `sort_order` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `chat_message` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `message_meta` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL,
  `message_type` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT 'text',
  `message_status` enum('read','unread') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'unread',
  `created_at` timestamp(0) NOT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `sender_id`(`sender_id`) USING BTREE,
  INDEX `chat_session_id_sender_id`(`chat_session_id`, `sender_id`) USING BTREE,
  INDEX `local_id`(`local_id`) USING BTREE,
  CONSTRAINT `chatbull_chat_messages_ibfk_1` FOREIGN KEY (`chat_session_id`) REFERENCES `chatbull_chat_sessions` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `chatbull_chat_messages_ibfk_2` FOREIGN KEY (`sender_id`) REFERENCES `chatbull_users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 200 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

