-- ----------------------------
-- Table structure for chatbull_chat_requests
-- ----------------------------
DROP TABLE IF EXISTS `chatbull_chat_requests`;
CREATE TABLE `chatbull_chat_requests`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `chat_session_id` int(11) UNSIGNED NOT NULL,
  `sender_id` int(11) UNSIGNED NOT NULL,
  `requested_to` int(11) UNSIGNED NOT NULL,
  `requested_by` int(11) UNSIGNED NULL DEFAULT 0,
  `request_type` enum('new','forward') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'new',
  `message` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `request_status` enum('pending','accepted','cancelled','closed') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'pending',
  `created_at` timestamp(0) NOT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `sender_id`(`sender_id`) USING BTREE,
  INDEX `chat_session_id_sender_id`(`chat_session_id`, `sender_id`) USING BTREE,
  INDEX `requested_to_requested_by`(`requested_to`, `requested_by`) USING BTREE,
  CONSTRAINT `chatbull_chat_requests_ibfk_1` FOREIGN KEY (`chat_session_id`) REFERENCES `chatbull_chat_sessions` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `chatbull_chat_requests_ibfk_2` FOREIGN KEY (`sender_id`) REFERENCES `chatbull_users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `chatbull_chat_requests_ibfk_3` FOREIGN KEY (`requested_to`) REFERENCES `chatbull_users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 13 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

