-- ----------------------------
-- Table structure for chatbull_chat_sessions
-- ----------------------------
DROP TABLE IF EXISTS `chatbull_chat_sessions`;
CREATE TABLE `chatbull_chat_sessions`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `site_id` int(11) UNSIGNED NULL DEFAULT 0,
  `user_agent` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL,
  `port` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0',
  `requested_tag` int(11) NULL DEFAULT 0,
  `supported_tags` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL,
  `session_status` enum('requested','open','forward','closed','disconnected','on-hold') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'requested',
  `session_type` enum('public','private') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'public',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

