-- ----------------------------
-- Table structure for chatbull_chat_users
-- ----------------------------
DROP TABLE IF EXISTS `chatbull_chat_users`;
CREATE TABLE `chatbull_chat_users`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `chat_session_id` int(11) UNSIGNED NOT NULL,
  `user_id` int(11) UNSIGNED NOT NULL,
  `address_id` int(11) UNSIGNED NULL DEFAULT 0,
  `user_role` enum('agent','visitor') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'visitor',
  `is_typing` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0',
  `user_state` enum('in-chat','left') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'in-chat',
  `started_at` timestamp(0) NOT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE,
  INDEX `chat_session_id_user_id`(`chat_session_id`, `user_id`) USING BTREE,
  INDEX `address_id`(`address_id`) USING BTREE,
  CONSTRAINT `chatbull_chat_users_ibfk_1` FOREIGN KEY (`chat_session_id`) REFERENCES `chatbull_chat_sessions` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `chatbull_chat_users_ibfk_2` FOREIGN KEY (`user_id`) REFERENCES `chatbull_users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 15 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

